  `LAB_SERVICE_ID` bigint(20) default NULL,
  PRIMARY KEY  (`SERVICE_SPECIMEN_MAP_ID`),
  KEY `FKEF2965DCFC55FDF` (`EXPIRY_UNIT`),
  KEY `FKEF2965DCD382B481` (`SPECIMEN_ID`),
  KEY `FKEF2965DC756E2983` (`LAB_SERVICE_ID`),
  KEY `FKEF2965DCA64D1F4E` (`VOLUME_COLLECTED_UNIT`),
  KEY `FKEF2965DCBF3C8E58` (`VOLUME_UNIT`),
  CONSTRAINT `FKEF2965DCBF3C8E58` FOREIGN KEY (`VOLUME_UNIT`) REFERENCES `LOOKUPENTITY` (`LOOKUPID`),
  CONSTRAINT `FKEF2965DC756E2983` FOREIGN KEY (`LAB_SERVICE_ID`) REFERENCES `LABSERVICEMASTER` (`LAB_SERVICE_ID`),
  CONSTRAINT `FKEF2965DCA64D1F4E` FOREIGN KEY (`VOLUME_COLLECTED_UNIT`) REFERENCES `LOOKUPENTITY` (`LOOKUPID`),
  CONSTRAINT `FKEF2965DCD382B481` FOREIGN KEY (`SPECIMEN_ID`) REFERENCES `LOOKUPENTITY` (`LOOKUPID`),
  CONSTRAINT `FKEF2965DCFC55FDF` FOREIGN KEY (`EXPIRY_UNIT`) REFERENCES `LOOKUPENTITY` (`LOOKUPID`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

