insert into `REPORT` values (1,'<p align=\"center\"><strong>Report on Peripheral Smear</strong></p><p>&nbsp;</p><p><strong>Erythrocytes:</strong>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Anisocytosis, hypochromia, Occassional microcytes.</p><p><strong>Leukocytes:</strong>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Normal in number,morphology &amp; distribution.</p><p><strong>Platelets:</strong>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Adequate</p><p><strong>Haemoparasites:&nbsp;&nbsp;&nbsp;&nbsp;</strong>Nil</p><p><strong>Others:&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </strong>Nil</p><p><strong>Impression:&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; normal</strong></p>',NULL,9,NULL,NULL,NULL,NULL),(2,'<br /><p align=\"center\"><strong><u>X-RAY REPORT</u></strong></p><p align=\"center\"><strong><u>RADIOGRAPH OF THE CHEST(PA VIEW)</u></strong></p><p>&nbsp;</p><p><strong>Findings:</strong></p><p>Peribronchial cuffing is seen in the left upper zone.</p><p>No pleural effusion is seen.</p><p>The heart and mediastinum are within normal limits.</p><p>Domes of diaphragm, bony thorax and soft tissues are normal.</p><p><strong>Impression:</strong></p><p>Viral Pneumonitis.</p>',NULL,7,NULL,NULL,NULL,NULL),(3,'<p align=\"center\"><strong>Report on Peripheral Smear</strong></p><p>&nbsp;</p><p><strong>Erythrocytes:</strong>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Anisocytosis, hypochromia, Occassional microcytes.</p><p><strong>Leukocytes:</strong>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Normal in number,morphology &amp; distribution.</p><p><strong>Platelets:</strong>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Adequate</p><p><strong>Haemoparasites:&nbsp;&nbsp;&nbsp;&nbsp;</strong>Nil</p><p><strong>Others:&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&