drop table if exists `BED_BROWSER`;

CREATE ALGORITHM=UNDEFINED DEFINER=`test`@`%` SQL SECURITY DEFINER VIEW `BED_BROWSER` AS (select `BD`.`BED_ID` AS `BED_ID`,`BD`.`BED_NO` AS `BED_NO`,`S`.`SITE_ID` AS `SITE_ID`,`B`.`BLOCK_ID` AS `BLOCK_ID`,`F`.`FLOOR_ID` AS `FLOOR_ID`,`SER`.`SERVICE_CENTER_ID` AS `SERVICE_CENTER_ID`,`SP`.`SPID` AS `SPID`,`BT`.`BED_TYPE_ID` AS `BED_TYPE_ID`,`BD`.`BED_STATUS` AS `BED_STATUS`,`BD`.`BEDCATEGORY` AS `BEDCATEGORY`,`BD`.`BEDGENDER` AS `BEDGENDER` from ((((((`SITE` `S` left join `BLOCK` `B` on((`S`.`SITE_ID` = `B`.`SITE_PK`))) left join `FLOOR` `F` on((`B`.`BLOCK_ID` = `F`.`BLOCK_PK`))) left join `SERVICECENTER` `SER` on((`F`.`FLOOR_ID` = `SER`.`FLOOR_ID`))) left join `SERVICEPOINT` `SP` on((`SP`.`SERVICE_CENTER_ID` = `SER`.`SERVICE_CENTER_ID`))) join `SPPASSIVERESOURSEMAP` `BEDMAP`) join ((`BED` `BD` left join `BEDTYPE` `BT` on((`BT`.`BED_TYPE_ID` = `BD`.`BED_TYPE`))) left join `LOOKUPENTITY` `LOOKUP` on((`LOOKUP`.`LOOKUPID` = `BD`.`BED_STATUS`)))) where ((`BEDMAP`.`SPID` = `SP`.`SPID`) and (`BEDMAP`.`PASSIVERESOURCEID` = `BD`.`BED_ID`) and (`BD`.`BED_ID` is not null)));

